    myMap.events.add('click', function (e) {

      // Получение координат щелчка
      var coords = e.get('coords');
      if (myPlacemark) {
        myPlacemark.geometry.setCoordinates(coords);
        document.getElementById('LATITUDE').value= coords[0].toPrecision(6);
        document.getElementById('LONGITUDE').value= coords[1].toPrecision(6);
      } else 
      {
      myPlacemark = createPlacemark(coords);
      myMap.geoObjects.add(myPlacemark);
      document.getElementById('LATITUDE').value= coords[0].toPrecision(6);
      document.getElementById('LONGITUDE').value= coords[1].toPrecision(6);
      }


      if (amzya_district.contains(e.get('coords'))) {
      console.log('п. Амзя');
      document.getElementById('district').value=385;
    } else if (neft_district.contains(e.get('coords'))) {
      console.log('г. Нефтекамск');
      document.getElementById('district').value=386;
    } 

    else {
      console.log('Без района');
      document.getElementById('LATITUDE').value= '';
      document.getElementById('LONGITUDE').value= '';
      $('#errTerritory').modal();
    }

    //
     if (roads29.contains(e.get('coords'))) {
      //$('#info29roads').modal();
      //document.getElementById('LATITUDE').value= '';
      //document.getElementById('LONGITUDE').value= '';
      //myMap.geoObjects.remove(myPlacemark);
      myMap.geoObjects.add(myPlacemark);
    } 
    else {
      myMap.geoObjects.add(myPlacemark);
      //document.getElementById('LATITUDE').value= '';
      //document.getElementById('LONGITUDE').value= '';
      //$('#errTerritory').modal();
    }


    });
        
      function createPlacemark(coords) {
        return new ymaps.Placemark(coords, {}, {                
          preset: 'islands#redCircleIcon',
        });
      }

